import React from 'react';
import Header from './Header';

function HomePage() {
  return (
    <div>
      <Header />
      <div style={styles.container}>
        <h1 style={styles.heading}>Home Page</h1>
      </div>
    </div>
  );
}

const styles = {
  container: {
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
    maxWidth: '1200px',
    margin: '0 auto',
    display: 'flex',
    alignItems: 'center',
    flexDirection: 'column',
    minHeight: 'calc(100vh - 300px)', 
  },
  heading: {
    color: '#333',
    textAlign: 'center',
    paddingBottom: '10px',
    borderBottom: '4px solid #9A2250',
    display: 'inline-block',
    margin: '20px auto',
    width: '100%',
    maxWidth: '300px',
    fontWeight: 'bold',
  },
};

export default HomePage;
